import React from 'react';
import styled from 'styled-components';

const Headers:React.FC = () =>{
    return(
        <HeaderWrap>
            <HeaderContainer>
                <HeaderContent>
                    <div className="logo">
                        LOGO
                    </div>
                    <div className="menu">
                        <p>블로그</p>
                        <p>프로젝트</p>
                        <p>{`Q&A`}</p>
                    </div>
                    <div className="auth">
                        <p>로그인</p>
                        <p>회원가입</p>
                    </div>
                </HeaderContent>
            </HeaderContainer>
        </HeaderWrap>
    );
}

const HeaderWrap = styled.div`
    background-color:#33FF99;
    padding:20px 0px;
`;

const HeaderContainer = styled.div`
    width:1180px;
    margin:0 auto;
`;

const HeaderContent = styled.div`
    display:flex;
    justify-content:space-between;
    &>div{
        &>p{
            margin:0;
        }
    }
    &>.menu{
        display:flex;
    }
    &>.auth{
        display:flex;
        &>p{
            margin:
        }
    }
`;
export default Headers;
